import React, { useState, useEffect, useMemo } from 'react';
import { Calendar, momentLocalizer } from 'react-big-calendar';
import moment from 'moment';
import 'react-big-calendar/lib/css/react-big-calendar.css';
import 'bootstrap/dist/css/bootstrap.min.css';

const localizer = momentLocalizer(moment);

function App() {
  const [bookedSlots, setBookedSlots] = useState({});
  const [currentDate, setCurrentDate] = useState(new Date());
  const [selectedSlot, setSelectedSlot] = useState(null); // Stores selected date/time
  const [formData, setFormData] = useState({ name: '', email: '', phone: '' });

  // Mock API: Fetch booked slots
  useEffect(() => {
    const mockData = {
      '2025-02-15': ['09:00', '14:00'],
      '2025-02-20': ['12:00', '16:00'],
    };
    setBookedSlots(mockData);
  }, []);

  // Convert booked slots to event objects
  const events = useMemo(
    () =>
      Object.entries(bookedSlots).flatMap(([date, times]) =>
        times.map((time) => ({
          title: 'Booked',
          start: moment(`${date} ${time}`, 'YYYY-MM-DD HH:mm').toDate(),
          end: moment(`${date} ${time}`, 'YYYY-MM-DD HH:mm').add(2, 'hours').toDate(),
          allDay: false,
        }))
      ),
    [bookedSlots]
  );

  // Handle selecting a time slot
  const handleSelectSlot = ({ start }) => {
    const dateStr = moment(start).format('YYYY-MM-DD');
    const timeStr = moment(start).format('HH:mm');

    if (bookedSlots[dateStr]?.includes(timeStr)) {
      alert(`❌ The slot on ${dateStr} at ${timeStr} is already booked!`);
      return;
    }

    setSelectedSlot({ date: dateStr, time: timeStr }); // Store selected slot for booking
  };

  // Handle form submission
  const handleBookingSubmit = (e) => {
    e.preventDefault();
    if (!selectedSlot) return;

    const { date, time } = selectedSlot;

    // Save booking (mock API)
    setBookedSlots((prev) => ({
      ...prev,
      [date]: [...(prev[date] || []), time],
    }));

    alert(`✅ Booking confirmed for ${date} at ${time}!`);
    setSelectedSlot(null); // Reset after booking
    setFormData({ name: '', email: '', phone: '' }); // Clear form
  };

  return (
    <div className="App container mt-5">
      <header className="text-center mb-4">
        <h1>Booking Calendar</h1>
      </header>

      <div className="card shadow">
        <div className="card-body">
          <Calendar
            localizer={localizer}
            events={events}
            startAccessor="start"
            endAccessor="end"
            selectable
            onSelectSlot={handleSelectSlot}
            step={30}
            timeslots={4}
            defaultView="week"
            views={['week', 'day']}
            style={{ height: '70vh', minHeight: '500px' }}
            className="border-0"
            eventPropGetter={() => ({
              style: {
                backgroundColor: 'red',
                color: 'white',
                borderRadius: '5px',
                textAlign: 'center',
              },
            })}
          />
        </div>
      </div>

      {/* Booking Form */}
      {selectedSlot && (
        <div className="card shadow-lg mt-4">
          <div className="card-body">
            <h2 className="text-center mb-4">Booking Form</h2>
            <p className="text-center mb-4">
              You've selected: <strong>{selectedSlot.date} at {selectedSlot.time}</strong>
            </p>

            <form onSubmit={handleBookingSubmit}>
              <div className="mb-3">
                <label className="form-label">Your Name</label>
                <input
                  type="text"
                  className="form-control"
                  required
                  value={formData.name}
                  onChange={(e) => setFormData({ ...formData, name: e.target.value })}
                />
              </div>

              <div className="mb-3">
                <label className="form-label">Email</label>
                <input
                  type="email"
                  className="form-control"
                  required
                  value={formData.email}
                  onChange={(e) => setFormData({ ...formData, email: e.target.value })}
                />
              </div>

              <div className="mb-3">
                <label className="form-label">Phone</label>
                <input
                  type="tel"
                  className="form-control"
                  required
                  value={formData.phone}
                  onChange={(e) => setFormData({ ...formData, phone: e.target.value })}
                />
              </div>

              <div className="d-flex justify-content-between">
                <button type="submit" className="btn btn-success">Confirm Booking</button>
                <button type="button" className="btn btn-secondary" onClick={() => setSelectedSlot(null)}>
                  Cancel
                </button>
              </div>
            </form>
          </div>
        </div>
      )}
    </div>
  );
}

export default App;
